import styled from 'styled-components';

const Empty = styled.div`
  margin: 48px 30px 18px 30px;
`;

const Warpper = styled.div`
  display: block;
  margin-top: 148px;
  margin-left: auto;
  margin-right: auto;
  width: 10%;
`;

export default {
  Empty,
  Warpper
};
